import axios from 'axios';
import React from 'react'

const Login = () => {

    const handleSubmit = e => {
        e.preventDefault();

        const data = {
            username:this.username,
            password:this.password

        }
        axios.post("http://localhost:8080/authenticate",data)
            .then(res => {
                console.log(res)
            })
    }   



    return (
    <form onSubmit={this.handleSubmit}>
    <div className=' flex max-w-xl mx-auto border-b shadow items-center visible'>
        <div className='px-8 py-8'>
            <div className=''>
                <h1 className=' font-thin text-2xl tracking-wider'>Login</h1>
            </div>
            <div className='h-40 w-full my-4'>
                <label className=' block text-gray-600'>Username</label>
                <input type='email' className=' h-8 w-96 border px-3'></input>

                <label className=' block text-gray-600'>Password</label>
                <input type='password' className=' h-8 w-96 border px-3'></input><br/><br/>

                <button name='login' className=' bg-gray-600 text-white rounded-md px-1 py-1'>Login</button>
            </div>

        </div>
    </div>
    </form>
  )
}

export default Login
